const DOMAIN = "dev-yjoayq6jizu04vpi.us.auth0.com";  // Reemplaza con tu dominio de Auth0
const CLIENT_ID = "fL5D5isi5lrrwNgojkhJ8lBZ4XcsNIAj";       // Reemplaza con tu Client ID

function App() {
  return (
    <Router basename="/">
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
